import * as API from '../../API'
import { submitRating } from './submitRating';

export const SUBMIT_RATING = 'SUBMIT_RATING'

export default function submitRatingAsync () {
    return (dispatch) => {
        return API.submitRating()
        .then((responseData) => {
          console.log('Submitting Rating', responseData)
          dispatch(submitRating({
            'beer_id': 1,
            'user_id': 1,
            'beer_rating': 4.2,
            'comment': "Beer was nice"      
          }))
        })
    }
}
